import React, { Component } from 'react';
import './WorkHomePanel.css';

class WorkHomePanel extends Component {
  render() {
    return (
      <div className='work-home'>
        <h1>Work Container</h1>
        <p>This is the default page for </p>
      </div>
    );
  }
}

export default WorkHomePanel;
